sources.styles/utils/mixins.scss:
@mixin onTablet {
  @media (min-width: $tablet-min-width) {
    @content;
  }
}

@mixin onLaptop {
  @media (min-width: $laptop-min-width) {
    @content;
  }
}

@mixin constendPaddingInline() {
  padding-inline: 20px;

  @include onTablet {
    padding-inline: 72px;
  }

  @include onLaptop {
    max-width: 1020px;
    margin-inline: auto;
    padding-inline: 120px;
  }
}

.container {
  @include constendPaddingInline;
}

@mixin hover($property, $toValue) {
  transition: #{$property} 0.3s;
  &:hover {
    #{$property}: $toValue;
  }
}

@mixin pageGrid {
  --columns: 2;
  display: grid;
  grid-template-columns: repeat(var(--columns), 1fr);
  column-gap: 20px;

  @include onTablet {
    --columns: 6;
    column-gap: 24px;
  }

  @include onLaptop {
    --columns: 12;
  }
}

