    @include onLaptop {
      gap: 24px;
      grid-template-columns: repeat(12, 1fr);
    }
  }

  &__form {
    margin-bottom: 48px;

    @include onTablet {
      grid-column: span 3;
      margin-bottom: 0;
    }

    @include onLaptop {
      grid-column: span 5;
    }
  }

  &__find-us {
    @include onTablet {
      grid-column: span 2;
    }

    @include onLaptop {
      grid-column: 8 / 11;
    }
  }

  &__item {
    margin-bottom: 24px;
  }

  &__text {
    margin-bottom: 8px;
    font-style: normal;
    font-size: 14px;
    line-height: 140%;
  }

  &__link {
    color: inherit;
    text-decoration: none;
    font-style: normal;
    font-weight: 500;
    font-size: 16px;
    line-height: 140%;
    transition: color 0.3s;

    &:hover {
      color: aqua;
    }
  }
}

